import React from "react";
import { NavLink } from "react-router-dom";


const Card =(props)=>{
    return(
        <>
    <div className='col-md-4 col-10 mx-auto'>
    <div className="card" style={{width:'18rem'}}>
    <img src={props.imgsrc} className="card-img-top" alt={props.imgsrc}/>
    <div className="card-body">
    <h5 className="card-title font-weight-bold mx">{props.title}</h5>

    <div class="dropdown">
    <NavLink className="btn btn-secondary dropdown-toggle" type="button" id="dropdownMenuButton1" data-bs-toggle="dropdown" aria-expanded="false">
    Dropdown button
    </NavLink>
    <ul class="dropdown-menu" aria-labelledby="dropdownMenuButton1">
    <li><NavLink className="dropdown-item" to={props.Link} >Module 1</NavLink></li>
    <li><NavLink className="dropdown-item" to={props.Link} >Module 2</NavLink></li>
    <li><NavLink className="dropdown-item" to={props.Link} >Module 3</NavLink></li>
    </ul>
    </div>

    </div>
    </div> 
    </div>
        </>
        );
};

export default Card;
